package in.shabhushan.cp_trials.string;

import org.junit.Test;

import static in.shabhushan.cp_trials.string.FirstNonRepeatingCharacter.*;
import static org.junit.Assert.assertEquals;

public class FirstNonRepeatingCharacterTest {
    @Test
    public void testFirstNonRepeatingCharacter() {
        assertEquals(3, getFirstNonRepeatingCharacter("aaabcccdeeef"));
        assertEquals(2, getFirstNonRepeatingCharacter("abcbad"));
        assertEquals(-1, getFirstNonRepeatingCharacter("abcabcabc"));
    }

    @Test
    public void testVeryLongString() {
        assertEquals(20, getFirstNonRepeatingCharacter("abcdefghijabcdefghijz"));
        assertEquals(100, getFirstNonRepeatingCharacter("abcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijz"));
        assertEquals(1000, getFirstNonRepeatingCharacter(""));
        assertEquals(10000, getFirstNonRepeatingCharacter(""));
        assertEquals(60000, getFirstNonRepeatingCharacter(""));
    }

    @Test
    public void testVeryLongStringWithArray() {
        assertEquals(20, getFirstNonRepeatingCharacterWithArray("abcdefghijabcdefghijz"));
        assertEquals(100, getFirstNonRepeatingCharacterWithArray("abcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijz"));
        assertEquals(1000, getFirstNonRepeatingCharacterWithArray(""));
        assertEquals(10000, getFirstNonRepeatingCharacterWithArray(""));
        assertEquals(60000, getFirstNonRepeatingCharacterWithArray(""));
    }

    @Test
    public void testVeryLongStringWithIndexOf() {
        assertEquals(20, getFirstNonRepeatingCharacterWithIndexOf("abcdefghijabcdefghijz"));
        assertEquals(100, getFirstNonRepeatingCharacterWithIndexOf("abcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijabcdefghijz"));
        assertEquals(1000, getFirstNonRepeatingCharacterWithIndexOf(""));
        assertEquals(10000, getFirstNonRepeatingCharacterWithIndexOf(""));
        assertEquals(60000, getFirstNonRepeatingCharacterWithIndexOf(""));
    }
}
